import UserTable from './components/UserTable';
import WorkGrid from './components/WorkGrid';
import './index.css';
import Navbar from './components/NavBar';


const App = () => {
  return (
    <div>
    <Navbar/>
    <div className="app-container">

      <div className="work-grid-container">
        <WorkGrid />
      </div>
    </div>
    </div>
  );
};

export default App;
